import React, { useState, useEffect } from 'react';
import { Link } from 'react-scroll';
import { NavLink } from 'react-router-dom';

export default function Header() {
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const onScroll = () => {
      setScrolled(window.scrollY > 300);
    };
    window.addEventListener('scroll', onScroll);
    return () => window.removeEventListener('scroll', onScroll);
  }, []);

  return (
    <header className={`header-container${scrolled ? ' scrolled' : ''}`}>
      <div className="logo-group">
        <img className="tablogo-img"    src="/assets/tablogo.jpg"      alt="Tab logo" />
        <img className="tablogo_text-img" src="/assets/logo updated.jpg" alt="Full logo" />
      </div>

      <nav className="nav-links">
        <ul>
          <li><NavLink to="/home"       end>Home</NavLink></li>
          <li><NavLink to="/about-us"   end>About Us</NavLink></li>
          <li><Link   to="product-services" smooth duration={900}>Products/Services</Link></li>
          <li><Link   to="partnerships"       smooth duration={500}>Partnerships</Link></li>
          <li><Link   to="education"          smooth duration={500}>Education</Link></li>
          <li><Link   to="resources"          smooth duration={500}>Resources</Link></li>
          <li><Link   to="events"             smooth duration={500}>Events</Link></li>
        </ul>
      </nav>
    </header>
  );
}
